import React from 'react';
import AddUser from './Components/Users/AddUser';
import UsersList from './Components/Users/UsersList';

function App() {
  const user = { name:"John", age :30 };
  return (
    <div>
      <AddUser/>
      <UsersList users={[user]}/>
    </div>
  );
}

export default App;
